const timestamp = new Date().getTime();
const mail = `test${timestamp}@email.com`;
const password = _faker.faker.internet.password();
const fullName = _faker.faker.person.fullName();
cy.get('a[href="/login"]').click();
cy.contains('New User Signup!').should('be.visible');
cy.get('input[data-qa="signup-name"]').type(fullName);
cy.get('input[data-qa="signup-email"]').type(mail);
cy.get('[data-qa="signup-button"]').click();
cy.contains('Enter Account Information').should('be.visible');
cy.get('input[type="radio"]').first().check();
cy.get('input[data-qa="name"]').type(fullName);
cy.get('input[data-qa="password"]').type(password);
cy.get('select[data-qa="days"]').select(_faker.faker.number.int({
  min: 1,
  max: 28
}).toString());
cy.get('select[data-qa="months"]').select(_faker.faker.date.month());
cy.get('select[data-qa="years"]').select(_faker.faker.date.birthdate({
  min: 18,
  max: 80,
  mode: 'age'
}).getFullYear().toString());
cy.get('input[id="newsletter"]').check();
cy.get('input[id="optin"]').check();
cy.get('input[data-qa="first_name"]').type(_faker.faker.person.firstName());
cy.get('input[data-qa="last_name"]').type(_faker.faker.person.lastName());
cy.get('input[data-qa="company"]').type(_faker.faker.company.name());
cy.get('input[data-qa="address"]').type(_faker.faker.location.streetAddress());
cy.get('input[data-qa="address2"]').type(_faker.faker.location.secondaryAddress());
cy.get('select[data-qa="country"]').select('Canada');
cy.get('input[data-qa="state"]').type(_faker.faker.location.state());
cy.get('input[data-qa="city"]').type(_faker.faker.location.city());
cy.get('input[data-qa="zipcode"]').type(_faker.faker.location.zipCode());
cy.get('input[data-qa="mobile_number"]').type(_faker.faker.phone.number());
cy.get('button[data-qa="create-account"]').click();
cy.contains('Account Created!').should('be.visible');
cy.get('[data-qa="continue-button"]').click();
cy.get('a[href="/logout"]').should('be.visible').click();
cy.url().should('include', '/login');
